import { combineReducers } from "redux";
import stdReducer from './studentReducers'
import eachListReducer from "./each_listReducer";

const rootReducer = combineReducers({
  std: stdReducer,
  each_list: eachListReducer,
  bk: bkReducer
});

export default rootReducer;
